const Home = () => {
    return ( 
        <div className="home-content">
            <div className="name-box">

                <div className="name">Anqi Chen.</div>
            </div>

            <div className="intro">
                <div className="intro-text">I study Architecture and Human-Computer Interaction @ Carnegie Mellon University.
                Actively seeking opportunity to explore Development & Design for Inclusion & Improvement. </div>

            </div>

        </div>
    );
}
 
export default Home;
